import React from 'react'
import '../styles/LawTexts.css'

class LawTexts extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            firstCountry: props.firstCountry,
            secondCountry: props.secondCountry
        }
        this.backButton = this.backButton.bind(this)
    }
    backButton(event){
        event.preventDefault()

    }
    render(){
        return(
            <center>
                <div className="row">
                    <div className="column">
                        First country is {this.state.firstCountry}.
                    </div>
                    <div className="column">
                        Second country is {this.state.secondCountry}.
                    </div>
                </div>
                <div>
                    <button className="btn btn-primary mt-3 mb-3" onClick={this.backButton}>Back</button>
                </div>
            </center>
        )
    }
}

export default LawTexts
